      'content-type': 'application/json'
    },
      body: JSON.stringify(project)
    }).then(response => {
      return response.json();
    }).catch(error => {
      return error;
    });
  }

  static deleteProject(id){
    return fetch(`http://localhost:3001/api/v1/projects/${id}`, {
      method: 'DELETE',
      headers: {
        'content-type': 'application/json'
      }
    }).then(response => {
      return response.json()
    }).catch(error => {
      return error;
    })
  }

  static retrieveProject(id){
    return fetch(`http://localhost:3001/api/v1/projects/${id.id}`, {
      method: 'GET',
    }).then(response => {
      return response.json()
    }).catch(error => {
      return error;
    })
  }

}

export default projectApi
